import React from 'react'
import "./Require.css"
function Require({setrequires,require}) {

    const Click=()=>{
      if(!require.includes("Frontend")){
          setrequires(require => [...require, "frontend"])
      }
    }

  return (
    <div className="requirement" onClick={Click}>
        <p>Frontend</p>
    </div>
  )
}

export default Require
